import {
  Form,
  FormControl,
  FormLabel,
  Button,
  FormGroup,
} from 'react-bootstrap';

const Login = () => {
  const submitHandler = (e) => {
    e.preventDefault();
  };

  return (
    <Form onSubmit={submitHandler}>
      <FormGroup>
        <FormLabel> Name </FormLabel>
        <FormControl />
      </FormGroup>
      <FormGroup>
        <FormLabel> Email </FormLabel>
        <FormGroup type="email" />
      </FormGroup>
      <Button type="submit">Login</Button>
    </Form>
  );
};

export default Login;
